def bin_lookup( value, sarray):
    
    start  = 0
    end    = len( sarray ) - 1

    

    while( 1 ):
        middle = int( start + (end-start)/2 ) 
#        print "%d -> %d <- %d" % ( start, middle, end )
#        print "%d ==> %d -> %d <- %d" % ( value, sarray[start], sarray[middle], sarray[end] )

        if (sarray [ middle ] == value ):
            return middle + 1

        if (middle  == start or middle == end ):
            return -1

        elif (sarray [ middle ] < value ):
            
            start = middle
        else:
            end = middle

